🚨🚨⚠️⚠️ *URNAS FORAM ENCONTRADAS DESCARTADAS ILEGALMENTE NO DMLU DE PORTO ALEGRE* ⚠️⚠️🚨🚨  Segundo morador da região e trabalhador da reciclagem local, Gilmar Alencar, por volta das 01:45 da manhã um furgão/van de cor preta estacionou perto de um matagal próximo ao aterro sanitário e descartou as urnas já destruídas.  Segundo Gilmar, 3 homens descarregarsm o veículo sem identificação aparente (empresa ou órgão governamental), estavam vestidos de preto e, apesar do horário, faziam uso de bonés.  *LF*

